export default function DraggableItem({ course, index, courseNr }) {
  return (
    // <Draggable key={course.courseNr} draggableId={course.courseNr} index={index}>
    <div className={styles.mainComponent}>
        <div className={styles.dragComponent}>
            <FontAwesomeIcon icon={faPenToSquare} className={styles.editNote} />
        </div>
        <div className={styles.courseTitle}>{course}</div>
    </div>
    // </Draggable>
  )
}
